import React from 'react';

const Cell = ({ value }) => {
    return (
        <div
            style={{
                width: '50px',
                height: '50px',
                border: '1px solid #ccc',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                fontSize: '20px'
            }}
        >
            {value}
        </div>
    );
};

export default Cell;
